import { type } from "os";
import { Table } from "react-bootstrap";
import IExpenseItem from "../models/expense";


type ExpenseItemsModel = {
    expenseItems: IExpenseItem[];
}

const ExpenseItems = ( expenseItems : ExpenseItemsModel) => {

    const defaultExpenseItems = [
        {
          "expenseDescription": "Internet Expenses",
          "payeeName": "Ramesh",
          "price": 1100,
          "date": "2023-02-26T00:00:00.000Z",
          "id": 1
        },
        {
          "expenseDescription": "Bike Maintainence Expenses",
          "payeeName": "Rahul",
          "price": 3500,
          "date": "2023-02-26T00:00:00.000Z",
          "id": 2
        },
        {
          "expenseDescription": "Electricity Bill - Nov Month",
          "payeeName": "Ramesh",
          "price": 2200,
          "date": "2023-02-26T00:00:00.000Z",
          "id": 3
        },
        {
          "expenseDescription": "Dinner Expenses - Friday Night",
          "payeeName": "Rahul",
          "price": 1750,
          "date": "2023-02-26T00:00:00.000Z",
          "id": 4
        },
        {
          "expenseDescription": "Saturday - Movie Night",
          "payeeName": "Ramesh",
          "price": 920,
          "date": "2023-02-26T00:00:00.000Z",
          "id": 5
        }
      ]

    return (
        <div>
            <Table striped bordered hover>
                <thead>
                    <tr>
                        <th>#</th>
                        <th>Expense Description</th>
                        <th>Payee Name</th>
                        <th>Expense Date</th>
                        <th>Price</th>
                    </tr>
                </thead>
                <tbody>
                    {
                        defaultExpenseItems.map((expenseItem, index) => {
                            return (
                                <tr>
                                    <td>{index}</td>
                                    <td colSpan={2}>Larry the Bird</td>
                                    <td>@twitter</td>
                                </tr>
                            );
                        })

                    }
                </tbody>
            </Table>
        </div>
    );
}

export {ExpenseItems}
